// Combine all inputs: current parsed data (single item) and the limited history rows
const items = $input.all();
let currentData = null;
const previousGainers = [];
const previousLosers = [];

items.forEach(item => {
  const data = item.json;
  if (!data) return;

  // If it looks like the parsed snapshot (has gainers/losers arrays), use as currentData
  if (data.gainers && data.losers && Array.isArray(data.gainers) && Array.isArray(data.losers)) {
    currentData = data;
    return;
  }

  // Otherwise treat as a history row (single row with symbol, change_percent etc.)
  if (data.symbol && data.change_percent !== undefined && data.rank !== undefined) {
    // decide by sign of change_percent whether it is gainers or losers row
    const pct = parseFloat(data.change_percent);
    if (!isNaN(pct) && pct >= 0) previousGainers.push(data);
    else if (!isNaN(pct) && pct < 0) previousLosers.push(data);
  }
});

return [{ json: { currentData: currentData, previousGainers: previousGainers, previousLosers: previousLosers } }];

// Detect changes between current top-5 and limited previous 5 rows
const inputItem = $input.all()[0];
