// Build latest position map from previous limited history
function latestPositionMap(historyRows) {
  const map = {};
  // assume historyRows are rows; if multiple timestamps for same symbol exist we keep newest (they were limited by timestamp earlier)
  historyRows.forEach(r => {
    const sym = r.symbol;
    const rank = parseInt(r.rank);
    if (!sym || isNaN(rank)) return;
    if (!map[sym] || new Date(r.timestamp || 0) > new Date(map[sym].timestamp || 0)) {
      map[sym] = { rank: rank, timestamp: r.timestamp };
    }
  });
  return map;
}

const prevGMap = latestPositionMap(previousGainers);
const prevLMap = latestPositionMap(previousLosers);

const changes = { gainers: [], losers: [], hasChanges: false };

